INSERT INTO `posts` (`id`, `title`, `image`, `description`, `views`, `meta_words`, `meta_description`, `status`, `created_at`, `updated_at`) VALUES
(2, 'त्रिविको सम्पति छानबिन आयोगद्वारा प्रधानमन्त्रीलाई प्रतिवेदन हस्तान्तरण', 'images/1734521639.jpg', '<p><span style=\"font-family: &quot;Impact&quot;;\">                                    \r\n                                </span><p><strong><span style=\"font-family: &quot;Impact&quot;;\">काठमाडौँ ।</span></strong><span style=\"font-family: &quot;Impact&quot;;\"> प्रधानमन्त्री केपी शर्मा ओलीसमक्ष \r\nत्रिभुवन विश्वविद्यालयको जग्गा तथा सम्पति खोजबिन आयोगले आज प्रतिवेदन \r\nहस्तान्तरण गरेको छ । शिक्षा, विज्ञान तथा प्रविधिमन्त्री विद्या भट्टराई र\r\n विश्वविद्यालयका पदाधिकारीसहितको उपस्थितिमा आयोगका सदस्य महेन्द्र थापाले\r\n प्रधानमन्त्री निवास बालुवाटारमा सो प्रतिवेदन हस्तान्तरण गर्दै \r\nप्रतिवेदनको सारांशबारे ब्रिफिङ गरेका हुन् ।</span></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/DWYZT6SVqAkHpFIvOZHNr8WWFf85hrFjnpYIEp75.gif\"><img src=\"https://jawaaf.com/storage/DWYZT6SVqAkHpFIvOZHNr8WWFf85hrFjnpYIEp75.gif\" width=\"300\" height=\"300\" style=\"width: 25%; float: left;\" class=\"note-float-left\"></a></figure><p></p><p><span style=\"font-family: &quot;Impact&quot;;\">गत जेठ १७ गते मन्त्रीपरिषद् द्वारा पूर्वसचिव शारदाप्रसाद त्रितालको संयोजकत्वमा पाँच सदस्यीय आयोग गठन गरिएको थियो ।</span></p><p><span style=\"font-family: &quot;Impact&quot;;\">आयोगले\r\n यही मङ्सिर १४ गते शिक्षा, विज्ञान तथा प्रविधिमन्त्री विद्या भट्टराई \r\nप्रतिवेदन बुझाएको थियो । प्रतिवेदन बुझेपछि प्रधानमन्त्री ओलीले छानबिनमा \r\nसक्षम व्यक्तिको संयोजकत्वमा आयोग गठन गरिएको उल्लेख गर्दै प्रतिवेदनले \r\nऔँल्याएका निष्कर्षलाई अविलम्ब कार्यान्वयन गर्दै थप अध्ययन र खोजबिन \r\nगर्नुपर्ने बताए ।</span></p><p></p><p></p><p><span style=\"font-family: &quot;Impact&quot;;\">आयोगले\r\n अध्ययन गर्न नभ्याएका र नसकेका क्षेत्रलाई पनि थप अध्ययन गरी निचोडमा \r\nपुग्नुपर्ने प्रधानमन्त्री एवं त्रिविका कुलपति ओलीको भनाइ थियो ।</span></p><p><span style=\"font-family: &quot;Impact&quot;;\">संयोजक\r\n त्रिताल अस्वास्थ्य भएका कारण सदस्य महेन्द्र थापाले संयोजन गरी \r\nप्रतिवेदनलाई अन्तिम रूप दिएका थिए । प्रतिवेदनले विसं २०१३ सालदेखिका \r\nत्रिविको कीर्तिपुर, नैकाप, ढुङ्गेअड्डा, पाटनलगायत काठमाडौँ उपत्यकाका २१ \r\nक्याम्पसका जग्गाको अवस्था, दुरुपयोग र उपयोगका लागि समाधानका उपायहरू समेत\r\n सुझाएको छ । समितिले जग्गाको दुरुपयोग भएका सम्बन्धमा अख्तियार दुरुपयोग \r\nआयोग र नेपाली प्रहरीको केन्द्रीय अनुसन्धान ब्युरोमा लेखी पठाउन पनि सुझाव\r\n दिइएको छ ।</span></p><p></p><a href=\"https://jawaaf.com/storage/ZXvglHqf0TJm5h4uUZKU9Hppc4Ua1S6UYN0Zcddh.gif\"></a></p>', 1, NULL, NULL, 'approved', '2024-12-18 05:48:59', '2024-12-23 03:36:32');
INSERT INTO `posts` (`id`, `title`, `image`, `description`, `views`, `meta_words`, `meta_description`, `status`, `created_at`, `updated_at`) VALUES
(3, 'चुनावको समयमा रिपोर्टिङ उत्साहजनक भए पनि परिणाम चिन्ताजनक छ', 'images/1734522915.jpg', '<p><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\"><strong>काठमाडौँ । </strong></span><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">नेकपा एमालेको ‘स्थानीय तहमा पार्टी कामका \r\nसमस्या र समाधान’ विषयक राष्ट्रिय कार्यशाला च्यासलमा सुरु भएको छ । \r\nकेन्द्रीय संगठन विभागद्वारा आयोजित दुई दिने कार्यशाल सुरु भएको हो ।</span></p><p><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">विभाग प्रमुख काशीनाथ अधिकारी</span><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">को अध्यक्षतामा जारी कार्यशालामा महासचिव शंकर पोखरेलले वार्षिक वाक्ययोजनाबारे दिशानिर्देश गरेका छन् ।</span></p><p><img style=\"width: 25%;\" src=\"data:image/jpeg;base64,\" data-filename=\"471312813_1003768065105340_8348493591018589926_n.jpg\"><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\"><br></span></p><p><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">दिशानिर्देश\r\n गर्दै पोखरेलले चुनावका समयमा जुन प्रकारको रिपोर्टिङ गरिन्छ त्यो आजको \r\nपरिणामका बीचमा कुनै एकता नभएको बताएका छन् । उनले चुनावको समयमा रिपोर्टिङ\r\n उत्साहित भए पनि परिणाम त्यो भन्दा भिन्न आएको बताएका हुन् ।</span></p><p><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">उनले\r\n भने, ‘विगतमा गठबन्धनसँग लडेको पार्टीले प्राप्त गरेको सफल</span><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">ता र अलग अलग \r\nलड्दाखेरी प्राप्त ग</span><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">र्नुपर्ने सफलताको सन्दर्भको कुरा गर्दा खेरी आज हामीले\r\n जे परिणाम प्राप्त गरेका छौं त्यो अत्यन्त चिन्ताजनक छ । त्यस माथि \r\nप्रदेशका हिसाबले हेर्ने हो भने पनि एक प्रकारले मतहरूको स्थिति हेर्ने हो \r\nभने पनि विगतका वर्षहरूमा गठबन्धन हुँदाखेरी उनीहरूले छोडेको सिटलाई समेत \r\nसमायोजन गरिकन मत विश्लेषण गर्न सकिन्छ । तर</span><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\"> चुनावका बेला साथिह</span><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">रूले जुन \r\nप्रकारको रिपोर्टिङ गर्नुभएको थियो त्यो उत्साहजनक थियो भने मत परिणाममा \r\nत्यो भन्दा भिन्न छ ।’</span></p><p><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\"><br></span></p><p><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\"><br></span></p><p><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">साथै,\r\n उनले देशलाई समृद्धिका आधारमा अगाडि बढाउने हो भने पनि त्यो जनता सामु \r\nराम्रो सन्देश पुग्न नसकेको बताए । उनले देशलाई समृद्धिका आधारमा अगाडि \r\nबढाउनका </span><span style=\"--darkreader-inline-bgcolor: inherit; background-color: inherit;\" data-darkreader-inline-bgcolor=\"\">लागि साना साना राजनीतिक दलहरू नभएर बलियो राजनीतिक दलहरू \r\nमिल्नुपर्ने बताए ।</span></p>', 1, NULL, NULL, 'approved', '2024-12-18 06:10:15', '2024-12-23 03:53:21');
INSERT INTO `posts` (`id`, `title`, `image`, `description`, `views`, `meta_words`, `meta_description`, `status`, `created_at`, `updated_at`) VALUES
(4, 'एनपिएलको फाइनलमा पुग्न कर्णाली र जनकपुर भिड्दै', 'images/1734840427.jpg', '<p><strong>काठमाडौं ।</strong> नेपाल प्रिमियर लिग (एनपीएल) अन्तर्गत \r\nबिहीबार दोस्रो क्वालिफायर हुँदैछ । यो भिडन्तमा इलिमिनेटरको विजेता \r\nकर्णाली याक्स र पहिलो क्वालिफायरमा पराजित जनकपुर बोल्टस्को रोचक भेट \r\nहुनेछ ।</p><p>दोस्रो\r\n क्वालिफायरको भेट एलिमिलेटरका विजेता कर्णाली याक्स र पहिलो क्वालिफायरमा \r\nहारेको टोली जनकपुरका लागि फाइनल पुगेर उपाधि होडमा रहने अन्तिम मौका हो ।</p><p>पहिलो\r\n क्वालिफायरमा विजेता टोली सुदूरपश्चिम फाइनलका लागि प्रतिस्पर्धी \r\nकुरिरहेको छ । दोस्रो क्वालिफायर विजेता टोलीसँग सुदूरपश्चिमले उपाधिका \r\nलागि प्रतिस्पर्धा गर्नेछ । यो खेल बिहीबार दिउँसो १२ ः ३० बजे \r\nकीर्तिपुरस्थित त्रिवि क्रिकेट मैदानमा हुनेछ ।</p><p></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/hpI8jCaF1d8okNDdaqJlsFC7Y1CHdMkOzPdFI4ks.gif\"><img src=\"https://jawaaf.com/storage/hpI8jCaF1d8okNDdaqJlsFC7Y1CHdMkOzPdFI4ks.gif\" width=\"300\" height=\"300\"></a></figure><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/Ljr9YG0IgkdFlbZH1ONYe3Y6Kt54DUKC9x7ohWB1.gif\"><img src=\"https://jawaaf.com/storage/Ljr9YG0IgkdFlbZH1ONYe3Y6Kt54DUKC9x7ohWB1.gif\" width=\"300\" height=\"300\"></a></figure><p></p><p>दोस्रो\r\n क्वालिफायर खेल जनकपुरका लागि अवसर हो । पहिलो क्वालिफायरमा \r\nसुदूरपश्चिमसँग हारेको टोली जनकपुरले दोस्रो क्वालिफायरमा कर्णालीलाई हराउन\r\n सके उपाधिका लागि सुदूरपश्चिमसँगै खेल्न पाउनेछ ।</p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/RS85QcTE5ZbzarKmk56pg1hW4nUjSv0fArLkrI8e.gif\"><img src=\"https://jawaaf.com/storage/RS85QcTE5ZbzarKmk56pg1hW4nUjSv0fArLkrI8e.gif\" width=\"300\" height=\"300\"></a></figure><p></p><p>तर\r\n जनकपुरका लागि सुदूरपश्चिमसँगका दुई भेट सुखद् छैनन् । पहिलो क्वालिफायरमा\r\n सुदूरपश्चिम रोयल्सले जनकपुर बोल्ट्सविरुद्ध ८ विकेटको फराकिलो जित \r\nनिकाल्यो ।&nbsp;</p><p>दोस्रो क्वालिफायरमा प्रतिस्पर्धा गर्न लागेका कर्णाली र\r\n जनकपुरको यो दोस्रो भेट हो । लिग चरणको खेलमा जनकपुरले कर्णालीलाई ८ \r\nविकेटले हराएको थियो ।</p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/EdZdzrK9gQ3Josz7ts5ehvUJGFuXuj27ylD4GWyO.gif\"><img src=\"https://jawaaf.com/storage/EdZdzrK9gQ3Josz7ts5ehvUJGFuXuj27ylD4GWyO.gif\" width=\"1250\" height=\"230\"></a></figure>&nbsp;', 0, NULL, NULL, 'approved', '2024-12-21 21:20:29', '2024-12-21 23:47:36'),
(5, 'एनपिएलको उपाधि जनकपुर बोल्ट्सलाई, सुदूरपश्चिम ५ विकेटले पराजित', 'images/1734843116.jpg', '<p><strong>काठमाडौं । </strong>सिद्धार्थ बैंक नेपाल प्रिमियर लिग(एनपिएल)\r\n को उपाधी जनकपुर बोल्ट्सले सुदूरपश्चिम रोयल्सलाई हराउँदै जितेको छ । \r\nशनिवार भएको फाइनल खेलमा जनकपुरले सुदूरपश्चिममाथि ५ विकेटको जित हात \r\nपारेको हो । ओपनर लाहिरु मिलन्थाको आक्रमक अर्धशतकमा पहिलो संस्करणको \r\nजितसँगै च्याम्पियन जनकपुरले ट्रफी सहित नगद रु १ करोड १० लाख प्राप्त \r\nगरेको छ । पराजित\r\n हुँदै उपविजेतामा सिमित बनेको सुदूरपश्चिमले नगद रु ५१ लाख प्राप्त गरेको छ\r\n । सुदूरपश्चिमले दिएको १ सय ८५ रनको लक्ष्य जनकपुरले १९.२ ओभरमा ५ विकेट \r\nगुमाएर पूरा गर्यो । जनकपुरका लाहिरु मिलन्थाले सर्वाधिक ८७ रन जोडे । उनले\r\n ४९ बलमा ९ चौका र ४ छक्का प्रहार गरेका थिए । <br></p><p><br></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/hXZ5oVbuoeofkcA7C6cEvtnq7fdOUZxZ5Ki8dKHe.gif\"><img src=\"https://jawaaf.com/storage/hXZ5oVbuoeofkcA7C6cEvtnq7fdOUZxZ5Ki8dKHe.gif\" width=\"300\" height=\"300\"></a></figure><p></p><p><br><br></p><p><br></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/SEO5PAIR2GmB77AUxDs2k0VasGwdris7Q5kC4RmR.gif\"><img src=\"https://jawaaf.com/storage/SEO5PAIR2GmB77AUxDs2k0VasGwdris7Q5kC4RmR.gif\" width=\"300\" height=\"300\"></a></figure><p></p><p><br>लिगको\r\n दोस्रो अर्धशतक ३१ बलमा पूरा गरे । १२औं ओभरको पहिलो बलमा मिलन्थाले \r\nजीवनदान पाएका थिए । उनलाई कप्तान दीपेन्द्रसिंह ऐरीले आफ्नै बलमा क्याच \r\nछोडेका थिए । त्यस समयमा मिलन्थाले ६५ रन बनाएका थिए । मिलन्थाले दुई वर्ष \r\nअघि भएको नेपाल टि ट्वान्टी लिगमा विराटनगर किंग्सलाई फाइनलमा पराजित गर्दा\r\n सर्वाधिक ४१ रन जोडेका थिए ।<br>पहिलो विकेटका लागि मिलन्था र आसिफ शेखले \r\n४२ बलमा ७३ रनको साझेदारी गरे । आसिफले १९ बलमा ४ चौका र २ छक्काको सहयोगमा\r\n ३३ रन जोडे । आसिफ सेफ अलि जेबको बलमा ब्राण्डन मक्मुलनबाट समातिए । हर्ष \r\nठाकरले बलमा चौका र छक्काको सहयोगमा नट आउट रन जोडे । मोहम्मद मोहसिन ८ \r\nबलमा ९ रन बनाउँदै इशान पाण्डेको बलमा बोल्ड भए ।</p><p><br></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/Nta5L4LS9kJ7Vtfx5yg1owtMxzSFIMJr7N4cgfrk.gif\"><img src=\"https://jawaaf.com/storage/Nta5L4LS9kJ7Vtfx5yg1owtMxzSFIMJr7N4cgfrk.gif\" width=\"1250\" height=\"230\"></a></figure><p></p><p><br>जेम्स\r\n निशम ४ जोड्दै कप्तान दीपेन्द्रसिंह ऐरीको बलमा बोल्ड आउट भए । \r\nसुदूरपश्चिमका लागि स्कट कुग्गेलेइन, सेफ अलि जेब र इशान पाण्डेले समान १ \r\nविकेट लिए ।<br>त्यसअघि टियु क्रिकेट मैदान कीर्तिपुरमा टस जितेर पहिले \r\nब्याटिङ गरेको सुदूरपश्चिमले निर्धारित २० ओभरमा ९ विकेट गुमाएर १ सय ८४ \r\nरनको बलियो योगफल तयार गरेको थियो । सुदूरपश्चिमका लागि सेफ अलि जेबले \r\nसर्वाधिक ६९ रन जोडे । उनले ४३ बलमा ८ चौका र २ छक्का प्रहार गरे ।</p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/c6leJPS9zBM8NbXvEgJlrRj63duVoiUjSwIWGi9l.gif\"><img src=\"https://jawaaf.com/storage/c6leJPS9zBM8NbXvEgJlrRj63duVoiUjSwIWGi9l.gif\" width=\"300\" height=\"300\"></a></figure><p></p><p><br>लिगमा\r\n दोस्रो अर्धशतक जेबले ३३ बलमा पूरा गरे । १२औं ओभरको पहिलो बलमा जेबले \r\nजीवनदान पाएका थिए । किशोर महतोको बलमा जेबको क्याच शेर मल्लले ड्रप गरेका \r\nथिए । त्यस समयमा जेबले ३९ बलमा ६४ रन जोडेका थिए । त्यसै ओभरको अनितम बलमा\r\n जेब बाउन्ड्रि नजिकै ललितनारायण राजवंशीबाट समातिए ।<br>पहिलो विकेटका \r\nलागि जैबले अर्का ओपनर विनोद भण्डारीसँग मिलेर ७२ बलमा १ सय १७ रनको \r\nमहत्वपुर्ण साझेदारी गरे । जैब आउट भएको अर्को ओभरमा विनोद पनि आउट भए । \r\nविनोद ३१ बलमा १ चौका र ३ छक्काको सहयोगमा ४१ रन जोड्दै आउट भए ।</p><p><br></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/eHo6pLohCocPd2Q72MGGp6MWS49wFT9BBbxWvsy3.gif\"><img src=\"https://jawaaf.com/storage/eHo6pLohCocPd2Q72MGGp6MWS49wFT9BBbxWvsy3.gif\" width=\"1250\" height=\"115\"></a></figure><p></p><p><br>हर्मित\r\n सिंह ८ बलमा १ छक्काको सहयोगमा १४ रन बनाउँदै आउट भए । उनी मोहम्मद \r\nमोहसिनको बलमा हेमन्त धामीबाट समातिए । ब्रेण्डन मक्मुलन १२ बलमा १ छक्काको\r\n सहयोगमा १४ रन बनाउँदै जेम्स निशमको बलमा बोल्ड आउट भए । १ सय १७ रन \r\nबनाउँदा कुनै विकेट नगुमाएको सुदूरपश्चिमले त्यसपछि निरन्तर विकेट गुमायो ।\r\n उसले पछिल्लो ९ विकेट गुमाउँदा ६७ रन मात्र जोड्न सक्यो ।<br>कप्तान \r\nदीपेन्द्रसिंह ऐरी ९, आरिफ शेख १ तथा स्कट कुग्गेलेइन ८ रनमा आउट भए । \r\nजनकपुरका लागि किशोर महतो र मोहम्मद मोहसिनले समान ३, ललितनारायण राजवंशी र\r\n जेम्स निशमले समान १ विकेट लिए ।<br>यस संस्करणमा यसअघि जनकपुर र सुदूरपश्चिमबीच दुई पटक भेट भएको थियो । दुवै खेलमा सुदूरपश्चिमले जनकपुरमाथि सहज जित हात पारेको थियो ।<br>पहिलो\r\n क्वालिफायर जित्दै सुदूरपश्चिमले सिधैं फाइनल यात्रा तय गरेको थियो । \r\nजनकपुर भने दोस्रो क्वालिफायरको बाटो हुँदै फाइनलसम्म पुगेको हो । दोस्रो \r\nक्वालिफायरमा जनकपुरले इलिमिनेटको विजेता कर्णाली याक्समाथि २ विकेटको कठिन\r\n जित हात पारेको थियो ।<br>एनपिएलमा तेस्रो भएको कर्णाली याक्सले २५ लाख र चौथो चितवन राइनोजले १५ लाख रुपैयाँ प्राप्त गर्नेछन् ।</p><p></p><a href=\"https://jawaaf.com/storage/FYhaDJ4Gxznlrl1OWitDMVFyg95uJpmIMuJREGZC.gif\"><img src=\"https://jawaaf.com/storage/FYhaDJ4Gxznlrl1OWitDMVFyg95uJpmIMuJREGZC.gif\" width=\"1250\" height=\"230\"></a>', 1, NULL, NULL, 'approved', '2024-12-21 21:24:03', '2024-12-23 04:02:52'),
(6, 'दीपेन्द्रसिंह ऐरीले जिते ओमोडा कार, ललितलाई इलेक्ट्रिक बाइक', 'images/1734845943.jpg', '<p><strong>काठमाडौं । </strong>नेपाल प्रिमियर लिग एनपीएलमा उत्कृष्ट \r\nप्रदर्शन गरेका नेपाली खेलाडी दीपेन्द्रसिंह ऐरीले ‘इलेक्ट्रिकफाइिङ प्लेयर\r\n अफ द टुर्नामेन्ट’ अवार्ड प्राप्त गर्दै ओमोडा कार जितेका छन् ।</p><p>नेपाली\r\n बजारमा ६२ लाख रुपैयाँ मूल्य पर्ने ओमोडा इ फाइभ डीएलक्स कार उनले प्राप्त\r\n गरेका हुन् । यसको साथै, अल्ट्राभाइलेट इलेक्ट्रिक बाइक ललित राजवंशीले \r\nजितेका छन् । एनपीएलमा लुम्बिनी लायन्सले फेयर प्ले अवार्ड जितेको छ ।</p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/YELy70Fzdzrdx1ElLd4Qy3ALupVQZ0hEEOmV8H44.gif\"><img src=\"https://jawaaf.com/storage/YELy70Fzdzrdx1ElLd4Qy3ALupVQZ0hEEOmV8H44.gif\" width=\"300\" height=\"300\"></a></figure><p></p><p>एनपीएलमा\r\n कुल ३४ चौका प्रहार गरेका लाहिरु मिलान्थताले ‘म्याक्स फोर अफ \r\nटुर्नामेन्ट’ को अवार्ड प्राप्त गर्नुको साथै २ लाख रुपैयाँ जितेका छन् ।&nbsp;</p><p>२०४ भन्दा माथिको स्ट्राइरेट भएका जनकपुर बोल्ट्सका जिम्मी निशम जिते बेस्ट ब्याटर बने भने उनले दुई लाख रुपैंयाँ नगद पाएका छन् ।&nbsp;</p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/TFJDaj0Nahl5iyHO8TeEWo02uOuXe8LJISlp4QTt.gif\"><img src=\"https://jawaaf.com/storage/TFJDaj0Nahl5iyHO8TeEWo02uOuXe8LJISlp4QTt.gif\" width=\"1250\" height=\"230\"></a></figure><p></p><p>१६\r\n वर्षका कर्णाली याक्सका विपिन शर्माले उदीयमान खेलाडी घोषित भएका छन् । \r\nउनले कर्णालीलाई प्लेअफमा पु¥याउन १३ विकेट लिएका थिए । ५० हजार रुपैयाँ \r\nनगद र प्रेजिडेन्सियल कलेजमा दश लाखको छात्रवृत्ति प्राप्त गरेका छन् ।&nbsp;</p><p>यसको\r\n साथै, जनकपुर बोल्ट्सका कप्तान आसिफ शेखले यो लिग जित्न पाउदा एकदमै खुसी \r\nलागेको बताएका छन् । उनले भने, ‘मेरो लागि यो जित हासिल गर्न पाउँदा एकदमै \r\nउत्साहित छु ।’&nbsp;</p><p>सोही क्रममा बोल्दै सुदूरपश्चिम रोयल्सका कप्तान \r\nदीपेन्द्रसिंह ऐरीले खेलमा हार जित भइरहने र अर्को पटक राम्रो गर्ने प्रयास\r\n रहने बताए ।</p><p></p><a href=\"https://jawaaf.com/storage/xvCWSJbLnsKQheoiUphKmc6kYbTkC9GBT1ZY3d0e.gif\"><img src=\"https://jawaaf.com/storage/xvCWSJbLnsKQheoiUphKmc6kYbTkC9GBT1ZY3d0e.gif\" width=\"300\" height=\"300\"></a>', 1, NULL, NULL, 'approved', '2024-12-21 23:54:03', '2024-12-23 03:36:37'),
(7, 'Kaluram Tamang’s Hobby Sparks a New Era in Oriental Cultural History', 'images/1734846559.jpg', '<span style=\"font-family: &quot;Segoe UI&quot;;\">                                    </span><p align=\"center\"><strong><span style=\"font-family: &quot;Segoe UI&quot;;\">Kathmandu.</span></strong><span style=\"font-family: &quot;Segoe UI&quot;;\"> In a tranquil corner of Baiteshwor-6, \r\nDolakha, a unique cultural treasure has emerged, combining passion, \r\ndedication, and a deep love for history. The Tamang Museum, founded by \r\nlocal businessman Kaluram Jimba Tamang of Namduka, is a groundbreaking \r\neffort to preserve and showcase the rich heritage of Tamang community \r\nand other oriental cultures. What began as a personal hobby has grown \r\ninto a cultural beacon, offering a window into the past for visitors and\r\n scholars alike.&nbsp;</span></p><p align=\"center\"><strong><span style=\"font-family: &quot;Segoe UI&quot;;\">&nbsp;A Vision Beyond Business</span></strong></p><p align=\"center\"><strong><span style=\"font-family: &quot;Segoe UI&quot;;\">&nbsp;</span></strong><span style=\"font-family: &quot;Segoe UI&quot;;\">Tamang,\r\n a businessman with a diverse educational background—having studied in \r\nNepal, Singapore, and the UK—initially envisioned a career in art. \r\nHowever, due to challenges with English proficiency and limited funds, \r\nhe was unable to pursue professional art full-time. Undeterred, Tamang \r\ntransformed his passion for history and culture into something much \r\nbigger. “I could not become a professional artist due to language \r\nbarriers and financial constraints at the start of my career,” says \r\nTamang, a member of Danfe Consulting Migration and Travel Company Pvt. \r\nLtd, Kathmandu. “But I have always had a deep interest in our history, \r\nand I decided to pursue it as hobby, something I could build and share.”</span></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">&nbsp;His\r\n dream materialized in the form of the Tamang Mini Museum, which \r\nfeatures a wide range of artifacts, from traditional Tamang costumes and\r\n jewelry to historical tools and manuscripts. Each exhibit tells a story\r\n of bygone era, offering a glimpse into the lifestyle and costumes of \r\nthe Tamang people and other neighboring cultures.</span></p><p align=\"center\"><br></p><p align=\"center\"><br></p><p align=\"center\"></p><div align=\"center\"><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/jpeg\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--jpg\"><a href=\"https://jawaaf.com/storage/loP1LQaN4BCe7P8oYcJCMxpQSmZJlrpRcJBKJ65h.jpg\"><img src=\"https://jawaaf.com/storage/loP1LQaN4BCe7P8oYcJCMxpQSmZJlrpRcJBKJ65h.jpg\" width=\"1024\" height=\"768\"></a></figure></div><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">Tamang, Founder of the Mini Tamang Museum, Explains Oriental Cultural Values</span></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">Photo: Courtesy of Tamang</span></p><p align=\"center\"><strong><span style=\"font-family: &quot;Segoe UI&quot;;\">A Cultural Hub in Dolakha</span></strong></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">The\r\n museum, though compact, is a vibrant space. It serves not only as a \r\nrepository of history but also as a platform for local and international\r\n visitors to engage with Nepal’s diverse cultural heritage. “The museum \r\nis not just about preserving objects; it is about sharing stories and \r\nfostering a deeper understanding of who we are as a people,” opines \r\nTamang.</span></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">While the museum primarily focuses on Tamang culture, it \r\nalso displays artifacts from other ethnic groups in the region, \r\nreflecting the interconnectedness of Nepal’s diverse communities. \r\nVisitors can explore rare and beautifully crafted items such as \r\ntraditional garments, religious symbols, and household items that have \r\nbeen passed down through generations.</span></p><p align=\"center\"><strong><span style=\"font-family: &quot;Segoe UI&quot;;\">A Future for Cultural Preservation</span></strong></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">Tamang’s\r\n vision for the museum extends beyond simply exhibiting artifacts. He \r\nhopes to inspire others to take an active role in preserving Nepal’s \r\nrich cultural history. As the museum continues to grow, Tamang plans to \r\nexpand its collection and offer educational programs, workshops, and \r\ncultural exchange opportunities.</span></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">“We live in a rapidly changing \r\nworld, but our culture is timeless. It is essential that we do \r\neverything we can to preserve it for future generations,” views Tamang. \r\nHis efforts are slowly gaining recognition, drawing attention from \r\ncultural enthusiasts, academics, and travelers alike.</span></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">The Tamang \r\nMini Museum represents more than just a personal achievement—it is a \r\nstep toward a broader movement to protect and celebrate Nepal’s cultural\r\n heritage in an era where globalization threatens to overshadow \r\ntraditional ways of life.</span></p><div align=\"center\"><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/jpeg\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--jpg\"><a href=\"https://jawaaf.com/storage/yj2EAOrba86x1y8WvJgfqseGJ3nQG2aYX66lk8Ej.jpg\"><img src=\"https://jawaaf.com/storage/yj2EAOrba86x1y8WvJgfqseGJ3nQG2aYX66lk8Ej.jpg\" width=\"1250\" height=\"230\"></a></figure></div><p align=\"center\"></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">Untold Stories in Strokes: Artworks by Tamang Unveil Cultural Depths</span></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">Images: Courtesy of Tamang, Saatchi Art</span></p><p align=\"center\"><strong><span style=\"font-family: &quot;Segoe UI&quot;;\">Visit the Tamang Mini Museum</span></strong></p><p align=\"center\"><span style=\"font-family: &quot;Segoe UI&quot;;\">For\r\n those interested in experiencing and exploring this unique cultural \r\nspace, the Tamang Mini Museum is located in Baiteshwor-6, Dolakha. This \r\nsmall but significant museum is an example of how passion can turn into \r\nsomething transformative, bridging the gap between history, culture, \r\nmyths, and future generations. </span><br></p><span style=\"font-family: &quot;Segoe UI&quot;;\">\r\n                                </span>', 1, NULL, NULL, 'approved', '2024-12-22 00:04:19', '2024-12-23 03:36:17'),
(8, 'रवि लामिछानेविरुद्ध आज कास्की जिल्ला अदालतमा मुद्दा दर्ता हुँदै', 'images/1734846670.jpg', '<p>                                    <p><strong>काठमाडौँ । </strong>राष्ट्रिय स्वतन्त्र पार्टी (रास्वपा) का \r\nसभापति रवि लामिछानेविरुद्ध आज कास्की जिल्ला अदालतमा मुद्दा दर्ता हुने \r\nभएको छ । आइतकार जिल्ला सरकारी वकिल कार्यालय कास्कीले सभापति रविविरुद्ध \r\nमुद्दा दायर गर्न लागेको हो ।</p><p><br></p><p><br></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/v91STzy3DigPzNBGvx0VhW8G7Il6FGZqI08dM02M.gif\"><img src=\"https://jawaaf.com/storage/v91STzy3DigPzNBGvx0VhW8G7Il6FGZqI08dM02M.gif\" width=\"300\" height=\"300\"></a></figure></p><p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><br></figure></p><p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><br></figure><p></p><p>रविविरुद्ध\r\n सहकारी ठगी, संगठित अपराध र सम्पत्ति शुद्धीकरण गरी ३ वटा अभियोग दर्ता \r\nगर्ने तयारी सरकारी वकिलको रहेको छ । हाल थुनामा रहेका गोर्खा मिडिया \r\nनेटवर्कका तत्कालीन प्रबन्ध निर्देशक लामिछाने, नेटवर्कका सञ्चालक एवं \r\nपूर्व डीआईजी छविलाल जोशी बञ्जाडे, लीला पछाई, </p><p><br></p><p><br></p><p>रामबहादुर खनाल र \r\nकृष्णबहादुर गुरुङसहित ५१ जनाविरुद्ध आइतवार अभियोग दर्ताको तयारी छ ।</p><p><br></p><p><br></p><p><br></p><p></p><a href=\"https://jawaaf.com/storage/FcScuo8ajifyCWxCgyO2RUigs6Y3Iet45WeJqJSP.gif\"><img src=\"https://jawaaf.com/storage/FcScuo8ajifyCWxCgyO2RUigs6Y3Iet45WeJqJSP.gif\" width=\"1250\" height=\"230\"></a>\r\n                                </p>', 2, NULL, NULL, 'approved', '2024-12-22 00:06:10', '2024-12-23 05:56:55'),
(9, 'चारवटा संसदीय समितिको बैठक बस्दै', 'images/1734846781.jpg', '<p>                                    </p><p><strong>काठमाडौँ ।</strong> संघीय संसद अन्तर्गत आज विभिन्न चारवटा \r\nसमितिको बैठक बस्दै छ । जसअनुसार,आज अर्थ, महिला तथा सामाजिक मामिला र \r\nपूर्वाधार विकास समितिका बैठक बिहान ११ बजे सिंहदरबारमा बस्ने छन् । बैठकमा\r\n सुरक्षित कारोबार ऐन, २०६३ लाई संशोधन गर्न बनेको विधेयकमाथि \r\nसंशोधनकर्तासँग छलफललाई निरन्तरता दिनुका साथै विधेयकमाथि दफावार छलफल \r\nगर्ने कार्यसूची छ ।</p><p><br></p><p><br></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/PkmcUQNco2Kr7Zn2GIjxtpkKE1MGPZuu8Il53bQE.gif\"><img src=\"https://jawaaf.com/storage/PkmcUQNco2Kr7Zn2GIjxtpkKE1MGPZuu8Il53bQE.gif\" width=\"300\" height=\"300\" style=\"width: 50%;\"></a></figure><p></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><br></figure><p></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><br></figure><p></p><p>कानून,\r\n न्याय तथा मानव अधिकार समितिको बैठकपनि बिहान साढे १० बजे समितिको सभाकक्ष\r\n सिंहदरबारमा बस्नेछ । बैठकमा केही नेपाल ऐनलाई संशोधन गर्न बनेको विधेयकको\r\n दफावार छलफल गर्ने कार्यसूची रहेको छ ।</p><p><br></p><p><br></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/nftbpXYgQBjeJpOUK1TBl3zSG3S8jYJnQsRytfBp.gif\"><img src=\"https://jawaaf.com/storage/nftbpXYgQBjeJpOUK1TBl3zSG3S8jYJnQsRytfBp.gif\" width=\"300\" height=\"300\" style=\"width: 25%;\"></a></figure><p></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><br></figure><p></p><p></p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><br></figure><p></p><p>यस्तै,बिहान\r\n ११ बजे सिंहदरबारमा बस्ने महिला तथा सामाजिक मामिला समितिको बैठकमा \r\nलैङ्गिक अल्पसङ्ख्यक समुदायहरूको पहिचान (तेस्रो लिङ्गी, ट्रान्सजेन्डर, \r\nपारलिङ्गी) अधिकार र समावेशीकरण सम्बन्धमा छलफल हुनेछ ।</p><p>त्यस्तै, \r\nपूर्वाधार विकास समितिको बैठकको समय तोकिएको छैन् । बैठकमा विद्युत् \r\nविधेयक, २०८० माथि संशोधनकर्ता सदस्यहरूसँग दफावार छलफल गर्ने कार्यसूची छ ।</p><p><br></p><p><br></p><p></p><a href=\"https://jawaaf.com/storage/RiFhcbbPd4zVJosFCiX0zwNQYsmYT4xCvpUJ7dgw.gif\"><img src=\"https://jawaaf.com/storage/RiFhcbbPd4zVJosFCiX0zwNQYsmYT4xCvpUJ7dgw.gif\" width=\"300\" height=\"300\" style=\"width: 25%;\"></a>\r\n                                <p></p>', 2, NULL, NULL, 'approved', '2024-12-22 00:08:01', '2024-12-23 06:12:48'),
(10, 'आजका लागि विदेशी मुद्राको विनिमय दर सार्वजनिक', 'images/1734846912.jpg', '<h3 class=\"py-5 description\">\r\n                            <p>काठमाडौँ । नेपाल राष्ट्र\r\n बैङ्कले आइतवारका लागि विदेशी मुद्राको विनिमय दर सार्वजनिक गरेको छ । \r\nजसअनुसार,आज अमेरिकी डलर एकको खरिददर एक सय ३५ रुपैयाँ ७३ पैसा र बिक्रीदर \r\nएक सय ३६ रुपैयाँ ३३ पैसा निर्धारित भएको छ ।</p><p><br></p><p><br></p><p>﻿<br></p><p>युरोपियन\r\n युरो एकको खरिददर एक सय ४१ रुपैयाँ र बिक्रीदर एक सय ४१ रुपैयाँ ६२ पैसा, \r\nयुके पाउण्ड स्टर्लिङ एकको खरिददर एक सय ६९ रुपैयाँ ७२ पैसा र बिक्रीदर एक \r\nसय ७० रुपैयाँ ४७ पैसा, स्विस फ्र्याङ्क एकको खरिददर एक सय ५१ रुपैयाँ ७० \r\nपैसा र बिक्रीदर एक सय ५२ रुपैयाँ ३७ पैसा कायम गरिएको छ ।</p><p><br></p><p><br></p><p><br></p><p><img style=\"width: 225px;\" src=\"data:image/jpeg;base64,\" data-filename=\"rastriya sakti nepal.jpg\"><br></p><p>यस्तै,अष्ट्रेलियन\r\n डलर एकको खरिददर ८४ रुपैयाँ ५० पैसा र बिक्रीदर ८४ रुपैयाँ ८७ पैसा, \r\nक्यानेडियन डलर एकको खरिददर ९४ रुपैयाँ ३२ पैसा र बिक्रीदर ९४ रुपैयाँ ७४ \r\nपैसा, सिङ्गापुर डलर एकको खरिददर ९९ रुपैयाँ ९० पैसा र बिक्रीदर एक सय \r\nरुपैयाँ ३४ पैसा तोकिएको छ ।</p><p>त्यस्तै,जापानी\r\n येन १० को खरिददर आठ रुपैयाँ ६६ पैसा र बिक्रीदर आठ रुपैयाँ ६९ पैसा, \r\nचिनियाँ युआन एकको खरिददर १८ रुपैयाँ ६० पैसा र बिक्रीदर १८ रुपैयाँ ६८ \r\nपैसा, साउदी अरेबियन रियाल एकको खरिददर ३६ रुपैयाँ १२ पैसा र बिक्रीदर ३६ \r\nरुपैयाँ २८ पैसा, कतारी रियाल एकको खरिददर ३७ रुपैयाँ २३ पैसा र बिक्रीदर \r\n३७ रुपैयाँ ४० पैसा कायम भएको छ ।</p><figure data-trix-attachment=\"{\" data-trix-content-type=\"image/gif\" data-trix-attributes=\"{\" class=\"attachment attachment--preview attachment--gif\"><a href=\"https://jawaaf.com/storage/B3FEQdb9AOVTyzqsnFUIQcEeyHheWyO4YHOaCum1.gif\"><img src=\"https://jawaaf.com/storage/B3FEQdb9AOVTyzqsnFUIQcEeyHheWyO4YHOaCum1.gif\" width=\"300\" height=\"300\"></a></figure><p>केन्द्रीय\r\n बैङ्कका अनुसार थाई भाट एकको खरिददर तीन रुपैयाँ ९४ पैसा र बिक्रीदर तीन \r\nरुपैयाँ ९६ पैसा युएई दिराम एकको खरिददर ३६ रुपैयाँ ९५ पैसा र बिक्रीदर ३७ \r\nरुपैयाँ १२ पैसा, मलेसियन रिङ्गेट एकको खरिददर ३० रुपैयाँ ११ पैसा र \r\nबिक्रीदर ३० रुपैयाँ २४ पैसा, साउथ कोरियन वन एक सयको खरिददर नौ रुपैयाँ ३७\r\n पैसा र बिक्रीदर नौ रुपैयाँ ४१ पैसा तोकिएको छ ।</p>\r\n                        </h3>', 6, NULL, NULL, 'pending', '2024-12-22 00:10:12', '2024-12-23 06:03:42'),
